/**
 * @param {number[]} maxHeights
 * @return {number}
 */
var maximumSumOfHeights = function(maxHeights) {
    const n = maxHeights.length;
    let maxSum = 0;

    // Iterate over each possible peak position
    for (let peak = 0; peak < n; peak++) {
        let sum = maxHeights[peak];
        let minHeight = maxHeights[peak];

        // Expand left from the peak
        for (let i = peak - 1; i >= 0; i--) {
            minHeight = Math.min(minHeight - 1, maxHeights[i]);
            if (minHeight > 0) sum += minHeight;
            else break; // Stop if minHeight is not valid
        }

        minHeight = maxHeights[peak];
        // Expand right from the peak
        for (let i = peak + 1; i < n; i++) {
            minHeight = Math.min(minHeight - 1, maxHeights[i]);
            if (minHeight > 0) sum += minHeight;
            else break; // Stop if minHeight is not valid
        }

        maxSum = Math.max(maxSum, sum);
    }

    return maxSum;
};
